  \"2015-01-22T15:57:47.467437\",\n\t\"name\": \"hud-program-income-limits\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Income limits used to determine the income
  eligibility of applicants for assistance under three programs authorized by the
  National Housing Act. These programs are the Section 221(d)(3) Below Market Interest
  Rate (BMIR) rental program, the Section 235 program, and the Section 236 program.
  These income limits are listed by dollar amount and family size, and they are effective
  on the date issued. Due to the Housing and Economic Recovery Act of 2008 (Public
  Law 110-289), Income Limits used to determine qualification levels as well as set
  maximum rental rates for projects funded with tax credits authorized under section
  42 of the Internal Revenue Code (the Code) and projects financed with tax exempt
  housing bonds issued to provide qualified residential rental development under section
  142 of the Code (hereafter referred to as Multifamily Tax Subsidy Projects (MTSPs))
  are now calculated and presented separately from the Section 8 income limits.\",\n\t\"license_title\":
